"The story behind Trillium’s founding and rise is a good one. Starting in a tiny space that was never meant for brewing in downtown Boston, Trillium has grown to multiple locations throughout greater Boston.

Esther and I discuss what it’s like to be on a non-stop rollercoaster of growth and expansion, whether Boston is a great beer city, and what the future holds for her Mrs. Trillium brand." - @beerscribe

@mrstrillium was recently a guest on The Beer Edge Podcast. Give a listen now at the link in our bio!
